import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Main from './components/Main';
import Nav from './components/Nav';

class App extends Component{
  render(){
      return (
        <Router>
           <Nav/>
      <Main/>


    <Switch>
          <Route exact path="/" component={Main}>
            <About /></Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
    </Router>
  );
}

}


export default App;
